#include <iostream>
#include <cmath>

using namespace std;

// Function to calculate parking charge for Short-Term Car Park (STCP)
double calculateSTCP(int hours) {
    double charge = 0.0;
    if (hours <= 3) {
        charge = hours * 5.00;
    } else if (hours <= 5) {
        charge = 3 * 5.00 + (hours - 3) * 4.00;
    } else if (hours <= 10) {
        charge = 3 * 5.00 + 2 * 4.00 + (hours - 5) * 3.00;
    } else if (hours <= 17) {
        charge = 3 * 5.00 + 2 * 4.00 + 5 * 3.00 + (hours - 10) * 2.00;
    } else {
        charge = 52.00;
    }
    return charge;
}

// Function to calculate parking charge for Long-Term Car Park (LTCP)
double calculateLTCP(int hours) {
    double charge = 0.0;
    if (hours <= 4) {
        charge = hours * 3.00;
    } else if (hours <= 14) {
        charge = 4 * 3.00 + (hours - 4) * 2.00;
    } else {
        charge = 32.00;
    }
    return charge;
}

// Function to calculate parking charge for Valet Parking
double calculateValet(int hours) {
    double charge = 0.0;
    charge = 16.00 + ceil((hours - 1) * 1.0) * 7.00; // rounding up to the next hour
    return charge;
}

int main() {
    int hours;
    cout << "Enter the number of hours: ";
    cin >> hours;

    // Calculate charges for each parking option
    double stcpCharge = calculateSTCP(hours);
    double ltcpCharge = calculateLTCP(hours);
    double valetCharge = calculateValet(hours);

    // Display charges for each parking option
    cout << "Short-Term Car Park (STCP) charge: RM " << stcpCharge << endl;
    cout << "Long-Term Car Park (LTCP) charge: RM " << ltcpCharge << endl;
    cout << "Valet Parking charge: RM " << valetCharge << endl;

    return 0;
}
